import './Todo.css';
import React from 'react'

function Todo(props) {
    return (
        <List>
            <ListItem>
                <ListItemAvatar>
                </ListItemAvatar>
                <ListItemText primary={props.text} secondary="Dummy Deadline 👁‍🗨"/>
                </ListItem>           
        </List>
    )
}

export default Todo
